  \"partial-pressure-or-fugacity-of-carbon-dioxide-dissolved-inorganic-carbon-alkalinity-temperatur5ce70\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0108095 includes discrete
  sample and profile data collected from ROGER REVELLE in the South Pacific Ocean
  and Southern Oceans (> 60 degrees South) from 2005-01-09 to 2005-02-19. These data
  include CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-113 (CFC-113), CHLOROFLUOROCARBON-12
  (CFC-12), Chromophoric Dissolved Organic Matter (CDOM), DELTA CARBON-13, DELTA CARBON-14,
  DELTA HELIUM-3, DISSOLVED INORGANIC CARBON (DIC), DISSOLVED ORGANIC CARBON, DISSOLVED
  OXYGEN, HELIUM, HYDROSTATIC PRESSURE, NEON, NITRATE, NITRITE, Potential temperature
  (theta), SALINITY, TOTAL ALKALINITY (TA), Tritium (Hydrogen isotope), WATER TEMPERATURE,
  phosphate and silicate. The instruments used to collect these data include Alkalinity
  titrator, CTD, Coulometer for DIC measurement and bottle.nnThese data were collected
  by Dennis Hansell of Rosenstiel School of Marine and Atmospheric Science, Christopher
  Sabine of US DOC; NOAA; OAR; Pacific Marine Environmental Laboratory and Andrew
  Dickson of University of California - San Diego; Scripps Institution of Oceanography
  as part of the CLIVAR_P16S_2005 data set. CDIAC associated the following cruise
  ID(s) with this data set: CLIVAR_P16S_2005nnThe International CLIVAR Global Ocean
  Carbon and Repeat Hydrography Program carries out a systematic and global re-occupation
  of select WOCE/JGOFS hydrographic sections to quantify changes in storage and transport
  of heat, fresh water, carbon dioxide (CO2), and related parameters.\",\n\t\"license_title\":
